import{ React,useState, useEffect} from 'react'
import CardList from "../CardList";
import axios from 'axios';
import properties from '../../properties'
import { Footer } from 'pages/HomePage/components/Footer';
import { PropertyListHeader } from 'pages/PropertyListHeader';
import { CardBox } from 'pages/CardBox';


 const PropertyList = () => {
     const [fetchProperties, setFetchProperties] = useState([]);


     useEffect(() => {
        getData();

     }, [])

    async function getData(fetch) {
        const propertiesResult = await axios.get(properties.properties_list_url);
        console.log(propertiesResult);
        setFetchProperties(propertiesResult.data.data);
    }
    return (
        <div>

             <h1>Property list</h1>

           <PropertyListHeader/>

            <Footer/>

                    {
                        fetchProperties.map((property,index)=>{
                            return (
                                <CardBox
                                city={property.city}
                                flatprice={property.flatprice}
                                location={property.location}
                                per_sqr_ft={property.persquarefit}
                                furnish_status={property.furnished}
                                images={property.images}
                                />




                                // <CardList
                                //     id={index + 1}
                                //     city={property.city}
                                //     location={property.location}
                                //     purpus={property.reason}
                                //     total_price={property.total_price}
                                //     per_sqt_ft={property.per_square_fit}
                                //     type={property.type}
                                //     bedroom={property.bedroom}
                                //     bathroom={property.bathroom}
                                //     balcony={property.balcony}
                                //     images={property.property_images}
                                // />

                        )})
                    }

        </div>
    )
}


export default  PropertyList
